import React from "react";
import {
    StyleSheet, 
    View,
} from  "react-native";
import {
    withTheme,
    ProgressBar,
    Text,
    IconButton,
    Subheading,
    Image
} from "react-native-paper";

function UnlockPremium(props) {
    const {theme} = props;
    return (
        <View style={styles.container}>
            <View>
                <Image source={{}}></Image>
                <ProgressBar></ProgressBar>
                <Subheading style={{marginTop: 8, textAlign: "center"}}>Converting Audio (12%)</Subheading>
            </View>
            <View style={{alignItems: "center"}}>
                <IconButton 
                    icon="close-circle"
                    size={80}
                />
            </View>
        </View>
    );
}

const styles = StyleSheet.create({
    container: { 
        backgroundColor: "#121212",
        paddingTop: 16,
        paddingBottom: 16,
        paddingLeft: 16,
        paddingRight: 16,
        flex: 1,
        display: "flex",
        justifyContent: "space-between"
    },
});

export default withTheme(UnlockPremium);
